import '../Styles/navbar.css'
import Logo from '../download.png'

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="logo">
                <img height="40px" width="80px" src={Logo} alt="" />
                {/* <img width="120px" height="60px" src="download.png" alt="" /> */}
            </div>
            <div className="nav_links">
                <ul>
                    <li><a href=""></a>Home</li>
                    <li><a href=""></a>Favourites</li>
                    <li><a href=""></a>Add To Favourites</li>
                    <li><a href=""></a>log-Out</li>
                </ul>
            </div>
        </div>
    );
}

export default Navbar;
